import React from "react";

export const Header = () => {
  return (
    <div className="mx-auto text-center p-5 bg-zinc-900 ">
      <div className="grid grid-cols-3">
        <div className="w-20 h-20 border border-2 border-white rounded-full bg-zinc-900"></div>

        <div className="col-span-2">
          <div className="text-2xl text-start font-bold text-white">
            {" "}
            mydrinkbar
          </div>

          <div className="flex text-white font-bold span text-xs">
            <button className="bg-slate-600 rounded-lg p-2 m-1">
              {" "}
              Followin
            </button>
            <button className="bg-slate-600 rounded-lg p-2 m-1">
              {" "}
              Message
            </button>
            <button className="bg-slate-600 rounded-lg p-2 m-1">Icon</button>
          </div>
        </div>
      </div>
      <div className="text-start text-white">
        <div className="font-bold">My Drink Bar</div>
        <div className="text-slate-400">Local Bussines</div>
        <div className="text-base">El lugar donde se detiene el tiempo</div>
      </div>
    </div>
  );
};
